/* eslint-disable react/jsx-pascal-case */
/* eslint-disable react/destructuring-assignment */
/* eslint-disable react/prop-types */
/* eslint-disable camelcase */
import React, { Component } from "react"
import { connect } from "react-redux"
import Navbar_logout from "../../components/Header/Navbar_logout"
import Navbar from "../../components/Header/Navbar"
import Banner from "./Banner/components/Banner"
import BestChoice from "./BestChoice/components/BestChoice"
import NoDistance from "./NoDistance/components/NoDistance"
import WhyNotUs from "./WhyChooseUs/WhyNotUs"
import Footer from "../../components/Footer/Footer"

class AboutUs extends Component {
  constructor(props) {
    super(props)
    this.state = {}
  }

  render() {
    return (
      <>
        {this.props.isLoggedIn ? <Navbar_logout isShow /> : <Navbar />}
        <Banner />
        <BestChoice />
        <NoDistance />
        <WhyNotUs />
        <Footer />
      </>
    )
  }
}

const mapStateToProps = (state) => ({
  isLoggedIn: state.header.isLoggedIn,
})

export default connect(mapStateToProps, null)(AboutUs)
